void readMap() {

	char buf[MAP_SIZE * 2 + 1] = { 0 };
	int fp = open(MAP_FILE, O_RDONLY);

	int ret = read(fp, &buf, MAP_SIZE * 2);
	if (0 == ret) {
		LOG_DEBUG("read buf size = 0!");
	}

	// char buf1[MAP_SIZE] = {0};
	for (int i = 0; i < MAP_SIZE * 2; i += 2) {
		fusion.freeSpaceCell[i / 2].Status = buf[i] - '0';
	}

	close(fp);
	return;
}

